import * as React from 'react'
import * as a from '../files/assets/social@2x.png'
import Card from '@material-ui/core/Card';
import CardHeader from '@material-ui/core/CardHeader';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import { withStyles, WithStyles } from '@material-ui/core/styles';
//import * as a from '../files/assets/social@2x.png'
import './loan-field.css'

const styles = theme => ({
    card: {
        width: 250
      },
      media: {
        height: 0,
        paddingTop: '56.25%'
        // 16:9
      },
    
  })

class CardFolder extends React.Component {
    render() {
        const {
            classes
        } = this.props
        return (
            <div className="pa2">
                <div>
                    
                </div>
                <div className="flex flex-row justify-center items-center ">
                    <div className="flex w-60 flex-row justify-center pt4 mt3">
                        <div className="flex flex-column ma3" style={{height: 500}}>
                            <Card className={classes.card}>
                                <CardMedia
                                  className={classes.media}
                                    image="http://tachyons.io/img/cat-720.jpg"
                                    title="Paella dish"
                                />
                                <CardContent>{this.props.cardContent}</CardContent>
                            </Card>
                        </div>
                        <div className="flex flex-column ma3" style={{height: 300}}>
                        <Card className={classes.card}>
                                <CardMedia
                                  className={classes.media}
                                    image="http://tachyons.io/img/cat-720.jpg"
                                    title="Paella dish"
                                />
                                <CardContent>{this.props.cardContent}</CardContent>
                            </Card>
                        </div>
                        <div className="flex flex-column ma3" style={{height: 500}}>
                        <Card className={classes.card}>
                                <CardMedia
                                  className={classes.media}
                                    image="http://tachyons.io/img/cat-720.jpg"
                                    title="Paella dish"
                                />
                                <CardContent>{this.props.cardContent}</CardContent>
                            </Card>
                        </div>
                        
                        <div className="flex flex-column ma3" style={{height: 300}}>
                        <Card className={classes.card}>
                                <CardMedia
                                  className={classes.media}
                                    image="http://tachyons.io/img/cat-720.jpg"
                                    title="Paella dish"
                                />
                                <CardContent>{this.props.cardContent}</CardContent>
                            </Card>
                        </div>
                   
                    </div>
                </div>
            </div>
        )
    }
}

export default withStyles(styles, { withTheme: true })(CardFolder)
